import axios from 'axios'

export const getProducts = (id) => {
    const res = axios.get(`https://fakestoreapi.com/products/category/${id}`)
    console.log(res)
    return { categories: ['men clothing', 'jewelery', 'electronics', 'women clothing'] }
}
